Locale.Place={

  parse: function(){
    n2p={}, p2c={}, c2d={};
    var provincePode;
    var cityPode;
    for (pode in Locale.PlaceSet) {
      if (pode.length===7) { // province
        n2p[pode]=Locale.PlaceSet[pode];
      }else if (pode.length===10) { // city
        provincePode=pode.substr(0,7);
        if (!p2c[provincePode]) p2c[provincePode]={};
        p2c[provincePode][pode]=Locale.PlaceSet[pode];
      }else if (pode.length===13) { // district
        cityPode=pode.substr(0,10);
        if (!c2d[cityPode]) c2d[cityPode]={};
        c2d[cityPode][pode]=Locale.PlaceSet[pode];
      }
    }
  },

  getPlace: function (rawPlace){
    if (typeof rawPlace==='string') {
      return {pode:rawPlace, name:Locale.PlaceSet[rawPlace]};
    }else if (typeof rawPlace==='object') {
      if (rawPlace.pode) {
        return {pode:rawPlace.pode, name:Locale.PlaceSet[rawPlace.pode]};
      }else if (rawPlace.name) {
        for (key in Locale.PlaceSet){
          if (Locale.PlaceSet[key]===rawPlace.name){
            return {pode:key, name:Locale.PlaceSet[key]};
          }
        }
      }
    }
    return {};
  },

  getSubPlaceSet: function (pode){
    var placeSet=[];
    if (pode && typeof pode==='string'){
      for (subPode in Locale.PlaceSet){
        if (subPode.substr(0,subPode.length-3)===pode){
          placeSet.push(this.getPlace(subPode));
        }
      }
    }
    return placeSet;
  },

  getOwnerPlace: function (pode){
    return this.getPlace(pode.substr(0,pode.length-3));
  },

  contain: function(ownerPode, subPode){
    if (subPode.substr(0,subPode.length-3)===ownerPode){
      return true;
    }
    return false;
  }

};

